lbard And Jan Mayen","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Cover letter from the Application Portal, signed by the applicant. If the applicant is a minor, the<\/div><div>cover letter must be signed by the parent(s) or legal guardian.<\/div><div>2. One (1) passport photo, not older than six (6) months, in color with a light background, 35 \u2013 40 mm<\/div><div>in width.<\/div><div>3. Passport (both new and old), valid at least three (3) months after the intended date of departure from<\/div><div>the Schengen area, containing at least two blank pages, and issued within the previous 10 years.<\/div><div>4. Copy of passport(s) (all used pages including the bio data page)<\/div><div>5. Original invitation letter dated and signed by the inviter\/sponsor in Svalbard\/ Spitsbergen, stating<\/div><div>the purpose and duration of the visit, the relation with the applicant and any other information about<\/div><div>the applicants visit (not older than three (3) months).<\/div><div>6. Original Guarantee Form for Visits filled out by the inviter\/sponsor in Svalbard and stamped by<\/div><div>Norwegian authorities + 1 copy (if the applicant does not have sufficient financial means to cover the<\/div><div>cost of travel).<\/div><div>7. Copy of inviter\/sponsor passport<\/div><div>8. A valid travel medical insurance for the duration of the intended stay in the Schengen area with a<\/div><div>minimum coverage of EURO 30.000<\/div><div>9. Flight booking of roundtrip air ticket to Svalbard (Longyearbyen), and other travels within the<\/div><div>Schengen area, if applicable. Do not purchase the ticket until a visa has been granted.<\/div><div>10. Minors (under 18 years of age):<\/div><div>- student card and\/or original letter from the school, mentioning:<\/div><div>o full address, telephone number(s) of the school<\/div><div>o name and function of the person giving permission<\/div>